import React, { useState } from 'react';

const EmployeeForm = () => {
  const [employeeData, setEmployeeData] = useState({
    name: '',
    email: '',
    mobile: '',
    designation: '',
    gender: '',
    course: [],
    image: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEmployeeData({ ...employeeData, [name]: value });
  };

  const handleCourseChange = (e) => {
    const value = e.target.value;
    setEmployeeData((prevData) => {
      if (prevData.course.includes(value)) {
        return { ...prevData, course: prevData.course.filter((c) => c !== value) };
      } else {
        return { ...prevData, course: [...prevData.course, value] };
      }
    });
  };

  const handleImageUpload = (e) => {
    setEmployeeData({ ...employeeData, image: e.target.files[0] });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(employeeData);
    // Logic to submit form data (e.g., send it to backend)
  };

  return (
    <div>
      <h2>Create Employee</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          placeholder="Name"
          value={employeeData.name}
          onChange={handleChange}
          required
        />

        <input
          type="email"
          name="email"
          placeholder="Email"
          value={employeeData.email}
          onChange={handleChange}
          required
        />

        <input
          type="text"
          name="mobile"
          placeholder="Mobile No"
          value={employeeData.mobile}
          onChange={handleChange}
          required
        />

        <select name="designation" value={employeeData.designation} onChange={handleChange} required>
          <option value="">Select Designation</option>
          <option value="HR">HR</option>
          <option value="Manager">Manager</option>
          <option value="Sales">Sales</option>
        </select>

        <div>
          <label>
            <input
              type="radio"
              name="gender"
              value="Male"
              checked={employeeData.gender === 'Male'}
              onChange={handleChange}
            />
            Male
          </label>

          <label>
            <input
              type="radio"
              name="gender"
              value="Female"
              checked={employeeData.gender === 'Female'}
              onChange={handleChange}
            />
            Female
          </label>
        </div>

        <div>
          <label>
            <input
              type="checkbox"
              value="MCA"
              onChange={handleCourseChange}
              checked={employeeData.course.includes('MCA')}
            />
            MCA
          </label>
          <label>
            <input
              type="checkbox"
              value="BCA"
              onChange={handleCourseChange}
              checked={employeeData.course.includes('BCA')}
            />
            BCA
          </label>
          <label>
            <input
              type="checkbox"
              value="BSC"
              onChange={handleCourseChange}
              checked={employeeData.course.includes('BSC')}
            />
            BSC
          </label>
        </div>

        <input type="file" name="image" onChange={handleImageUpload} accept="image/*" required />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default EmployeeForm;
